backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

random.tf.code:
resource "random_pet" "postfix" {
  length    = 1
  separator = "_"
}

resource "random_string" "random" {
  length  = 3
  special = false
  upper   = false
}

locals {
  parameter_name = "parameter_from_CloudAI_${random_string.random.result}"
}

ssm_parameter.tf.code:
resource "aws_ssm_parameter" "example" {
  name  = local.parameter_name
  type  = "String"
  value = "value"

  tags = {
    owner = "jeremy_wang"
  }
}
